
-- Maken Tabel Vermogensklassen
DROP TABLE IF EXISTS Vermogensklassen;
CREATE TABLE Vermogensklassen (
	Vermogensklasse VARCHAR(1) PRIMARY KEY,
    Vermogen VARCHAR(25) NOT NULL,
    Classificatie VARCHAR(20) NOT NULL
);

INSERT INTO Vermogensklassen(Vermogensklasse, Vermogen, Classificatie)
VALUES ('A', '<= 10kW', 'Laag'),
	   ('B', '> 10kW en <= 40kW', 'Laag'),
       ('C', '> 40kW en <= 250kW', 'Hoog'),
       ('D', '> 250kW en <= 750kW', 'Hoog'),
       ('E', '> 750kW', 'Extreem hoog');



-- Maken Tabel Zonnepanelen
DROP TABLE IF EXISTS zonnepanelen;
CREATE TABLE zonnepanelen(
   ObservatieID INT PRIMARY KEY AUTO_INCREMENT
  ,NIS_Code        VARCHAR(20)  NOT NULL
  ,Vermogensklasse VARCHAR(1) NOT NULL CHECK (Vermogensklasse IN ('A', 'B', 'C', 'D', 'E'))
  ,Vermogen        VARCHAR(30) NOT NULL
  ,Aantal          INT  NOT NULL
  ,Periode         INT
  ,FOREIGN KEY(NIS_Code) REFERENCES NIS_Codes(NIS_Code)
  ,FOREIGN KEY(Vermogensklasse) REFERENCES Vermogensklassen(Vermogensklasse)
  ,FOREIGN KEY(Periode) REFERENCES periodes(PeriodeID)
);

